import React from "react";
import { Text, View, StyleSheet } from "react-native";
import { NavigationContainer } from '@react-navigation/native';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';

const Tab = createBottomTabNavigator();

const Main = ({ }) => {
  return (
    <NavigationContainer>
      <Stack.Navigator
        screenOptions={{
          headerShown: false,
        }}
      >
        <Stack.Screen
          name="Home"
          component={Home}
          options={{ title: "Home" }}
        />
        <Stack.Screen
          name="Login"
          component={Login}
          options={{ title: "Login" }}
        />
        <Stack.Screen
          name="Register"
          component={Register}
          options={{ title: "Register" }}
        />
        <Stack.Screen
          name="Forgot"
          component={Forgot}
          options={{ title: "Forgot" }}
        />
        <Stack.Screen
          name="Main"
          component={Main}
          options={{ title: "Main" }}
        />
      </Stack.Navigator>
    </NavigationContainer>
  );
};

export default Main;
const styles = StyleSheet.create({
  container: {
    flex:1,
    justifyContent: "center",
    alignContent: "center",
   
  },
  text:{
    justifyContent: "center",
    alignContent: "center",
    
    fontWeight:"bold",
    fontSize:20,
    
  }
});
